import React from 'react';
import { Inter } from 'next/font/google'; // ¿Estás seguro de que esto es correcto?
import './styles.css';

const inter = Inter({
  subsets: ['latin'],
  display: 'swap',
  variable: '--font-inter',
})

export default function Layout({ children }) {
  return (
    <html lang="en">
      <body className={inter.variable}>
        {children}
      </body>
    </html>
  )
}
